            array('id' => '16','city_id' => '1','institution_id' => '971','name' => 'Avni','surname' => 'Koci','title' => 'Dr','email' => ' ','phone' => NULL,'contact' => NULL,'education' => ' ','working_hours' => '0','working_years' => '0','bio' => 'Ka përfunduar Shkolla e Mesme Mjekësore "Jani Minga" Vlorë, në 1972, për të vazhduar studimet e larta në Universiteti i Tiranës, Fakulteti i Mjekësisë dhe marë titullin Mjek i Përgjithshëm në 1977. Është specializuar në Anesteziologji - Reanimator në vitin 1985. Ka punuar si mjek anesteziolog - reanimator në spitali rajonal Librazhd, po në këtë qytet ka punuar si Drejtor i Drejtorisë së Shëndetit Publik dh evite më vonë si N/Drejtor, teknik i Drejtorisë  së Shërbimit Spitalor, Librazhd. Është anëtar i Urdhërit të mjekut dhe shoqatës së Mjekëve anesteziolog-ranimator te Shqiperisë.','img' => 'http://www.inig.customeyes.me/finddoc/n/a_koci_1.jpg','img_round' => 'http://www.inig.customeyes.me/finddoc/n/a_koci_2.jpg','likes' => '4','visible' => '1','deleted_at' => NULL,'created_at' => '2018-07-05 11:45:46','updated_at' => '2018-07-05 11:45:46'),
