            array('id' => '19','city_id' => '1','institution_id' => '971','name' => 'Edvin','surname' => 'Bekteshi','title' => 'Dr','email' => ' ','phone' => NULL,'contact' => NULL,'education' => ' ','working_hours' => '0','working_years' => '0','bio' => 'Ka përfunduar në 1998 Fakultetin e Mjekësisë Universiteti i Tiranës dhe ka marë titullin "Doktor i Përgjithshëm", Në 2003 ka studiuar në  "Università Degli Studi di Milano" Itali, "Attuale Orientamento Nella Terapia Chirurgica Del Laparocele", ku ka marë titullin  "Doktor i Përgjithshëm" me vlerësim maksimal. Në 2009 është specializuar si Anestezist dhe Reanimator në Fakulteti i Mjekësisë, Universiteti i Tiranës. Ka filluar punën si mjek I përgjithshëm në Durrës, në 2000 i punësuar pranë Qendrës së Kujdesit Shëndetësor, Drisht/Vilëz, Shkodër Mjek i Përgjithshëm, Drejtor i Qendrës PHC, në 2005 ka punuar në Piazza Nazionale 14, Trezzo S/Adda, (Mi), Itali, Doktor i Ndihmës së Parë, Drejtor Sanitar, Doktor Urgjence & Mjek i Përgjithshëm. Që nga viti 2011 punon si Anestezist dhe Doktor Urgjence në Departamentin e Anestezisë dhe Kujdesit Intensiv, në Spitali Amerikan 2.','img' => 'http://www.inig.customeyes.me/finddoc/n/e_bekteshi_1.jpg','img_round' => 'http://www.inig.customeyes.me/finddoc/n/e_bekteshi_2.jpg','likes' => '0','visible' => '1','deleted_at' => NULL,'created_at' => '2018-07-05 11:45:46','updated_at' => '2018-07-05 11:45:46'),
            array('id' => '20','city_id' => '1','institution_id' => '971','name' => 'Erjola','surname' => 'Piluri','title' => 'Dr','email' => ' ','phone' => NULL,'contact' => NULL,'education' => ' ','working_hours' => '0','working_years' => '0','bio' => 'Në vitin 2003 ka përfunduar studimet e larta në Fakultetin e Mjekësisë, Universiteti i Tiranës dhe ka mar titullin Mjeke e Përgjithshme. Në 2008 është specializuar në Sherbimin e Alergologjise & Immunologjise Klinike, duke mbrojtur Doktoraturën e saj me projektin kerkimor: "Epidemiologjia e Dermatit Atopik ne femjet e  moshes shkollore ne Tirane, dhe lidhja e tij me alergjite respiratore". Ka filluar punën e saj si Mjeke e Pergjithshme në Spitalin rajonal të Dibrës në vitin 2004. Gjithashtu për një peridhë një vjecare ka ushtruar detyrën e Nëndrejtor mjeksor i Drejtorisë Rajonale të Sigurimeve dhe Kujdesit Shëndetesor, Dibër. Ka punuar në QSUT pranë Shërbimit të Alergologjisë njëkohësisht edhe si pedagoge e jashtme pranë Fakultetit të Mjekësisë, Departamenti i Sëmundjeve të Brendshme,- Alergologji. Që nga prilli 2011 është mjeke Alergologe pranë Spitalit Amerikan.Gjithashtu është pjesmarrëse në një sërë konferencash shkencore si: Konferenca Shkencore "Alergjia: Fenotipet e saj", Konferenca e II-të Kombëtare  e Dermatologjisë dhe Venerologjise Shqiptare, Konferenca Kombëtare "Astma dhe Alergjia", Konferenca e 4 Internacionale të Perinatologjisë, Konferenca Internacionale "Toksikoinfeksionet ushqimore dhe siguria në ushqim". Është anëtare e disa shoqatave, Anëtare e Akademisë Europiane të Alergologjisë dhe Imunologjisë Klinike (EAACI), Anëtare e Shoqatës Shqiptare të Alergologjisë dhe Imunologjisë Klinike , Anëtare e Shoqatës Respiratore Europiane ( European Respiratory Society- ERS).','img' => 'http://www.inig.customeyes.me/finddoc/n/e_piluri_1.jpg','img_round' => 'http://www.inig.customeyes.me/finddoc/n/e_piluri_2.jpg','likes' => '6','visible' => '1','deleted_at' => NULL,'created_at' => '2018-07-05 11:45:46','updated_at' => '2018-07-05 11:45:46'),
            array('id' => '21','city_id' => '1','institution_id' => '971','name' => 'Leart','surname' => 'Berdica','title' => 'Dr','email' => 'leartberdica@ymail.com','phone' => NULL,'contact' => NULL,'education' => ' ','working_hours' => '0','working_years' => '0','bio' => 'Në vitin 2001 zhvillon një trajnim 8 mujor në Histo dhe Cytopatologji, Fakulteti i Mjekësisë, Universiteti i Barit, Itali. Është diplomuar në Fakultetin e Mjekësisë, Universiteti i Tiranës si mjek I përgjithshëm dhe ka mbrojtur doktoraturën për për Kancerin e prostatës në Shqipëri. Është Përgjegjës për Nefropatologjinë jotumorale pjesë e projektit të INTERREG III( bashkëpunim Shqipëri-Itali). Ka filluar punën e tij si Mjek i Përgjithshëm në shërbimin shëndetësor Shkodër, më vonë ka punuar dhe vazhdon të punojë si Anatomo-Patolog dhe pedagog me kohë të plotë në katedrën dhe Shërbimin e Anatomisë-Patologjike, Fakulteti i Mjekësisë në Tiranë dhe QSUT Nënë Tereza. Që nga viti 2008 punon gjithashtu edhe si Anatomo-Patolog në Spitalin Amerikan të Tiranës.','img' => 'http://www.inig.customeyes.me/finddoc/n/l_berdica_1.jpg','img_round' => 'http://www.inig.customeyes.me/finddoc/n/l_berdica_2.jpg','likes' => '1','visible' => '1','deleted_at' => NULL,'created_at' => '2018-07-05 11:45:46','updated_at' => '2018-07-05 11:45:46'),
