       Certifikate','working_hours' => '0','working_years' => '0','bio' => 'Doktor Besim Boçi ka mbi 20 vjet përvojë në specialitetin e Otorinolaringologjisë, Kirurgjinë e Kokës dhe të Qafës dhe Kirurgjinë Plastike të Fytyrës. Ka kryer një numër të madh operacionesh në kirurgjinë plastike të fytyrës si rinoplastika, otoplastika dhe blefaroplastika me rezultate estetike shumë të mira. Një përvojë shumë të madhe ka në kirurgjinë e qafës ku përfshihet kirurgjia e laringut si laringektomia totale (heqja e plotë e laringut), hemilaringektomia (heqja e pjesshme e laringut), heqja e polipeve në laring me shaver pa dëmtuar kordat vokale, heqja e masave tumorale në laring me radiofrekuencë dhe shaver me endoskopi, heqjen e masave tumorale në qafë të karakterit beninj apo malinj, kirurgjinë e gjendrave të pështymës, kryesisht të gjendrës parotis me ekspozim të nervit facial. Ka kryer për herë të parë rehabilitimin e të folurit tek të sëmurët që kanë hequr laringun me rezultate shumë të mira dhe sot numri i të sëmurëve të protezuar ka arritur në 150. Gjithashtu, një përvojë të madhe Dr. Besim Boçi ka në trajtimin e sëmundjeve të hundës dhe sinuseve me kirurgji të hapur dhe endoskopi, heqje e bajameve me radiofrekuencë, dhe e mishit të huaj (adenoideve)  me shaver dhe shumë ndërhyrje të tjera në këtë specialitet duke respektuar protokollet klinike.
Mbas përfundimit të specializimit të Otorinolaringologjisë në vitin 1999 filloi të ushtrojë aktivitetin në Shërbimin e Otorinolaringologjisë në Qendrën Spitalore Universitare. Në vitin 2001 specializohet në Itali për një periudhë një vjecare në Kirurgjinë e Kokës dhe të Qafës dhe Kirurgjinë Plastike të Fytyrës. Në vitin 2005 kryen kursin për Rinoplastikën në Hollandë pranë Academic Medical Center. Në vitin 2008 kryhen kurs intensiv për Diseksionin e Qafës në Londër, pranë Saint George Hospital. Në vitin 2008, 2009, 2012 kryen kurse intensive për Rehabilitimin e Zërit pranë Institutit të Kancerit në Hollandë. Në vitin 2013 kryhen kursin për Kirurgjinë e Lazerit në  Universitetin Montgodine, Belgjike. Në vitin 2014 kryhen kursin intensiv  për Kirurgjinë e Laringut në Krans Montana, Zvicër në bashkëpunim me Universitetin Montgodine Belgjike.

Nga viti 2003-2012 pedagog i jashtëm në lëndën e Otorinolaringologjisë

Në vitin 2012 pedagog i brendshëm në lëndën e Otorinolaringologjisë

Nga viti 2013 e në vazhdim Shefi i Shërbimit të Otorinolaringologjisë në QSUT

